detaileddescription.para:
Below is an example of an initialized GPIOCC26XX_Config structure: constGPIOCC26XX_ConfigGPIOCC26XX_config={
.pinConfigs=(GPIO_PinConfig*)gpioPinConfigs,
.callbacks=(GPIO_CallbackFxn*)gpioCallbackFunctions,
.numberOfPinConfigs=sizeof(gpioPinConfigs)/sizeof(GPIO_PinConfig),
.numberOfCallbacks=sizeof(gpioCallbackFunctions)/sizeof(GPIO_CallbackFxn),
.intPriority=(~0)
};

listitem.para:
An array of GPIO_PinConfig elements that defines the initial configuration of each pin used by the application. A pin is referenced in the application by its corresponding index in this array. The pin type (that is, INPUT/OUTPUT), its initial state (that is OUTPUT_HIGH or LOW), interrupt behavior (RISING/FALLING edge, etc.) (see Macros used to configure GPIO pins), and device specific pin identification (see GPIO pin identification macros used to configure GPIO pins) are configured in each element of this array. Below is an CC26XX device specific example of the GPIO_PinConfig array: //
//ArrayofPinconfigurations
//NOTE:Theorderofthepinconfigurationsmustcoincidewithwhatwas
//definedinCC2650_LAUNCH.h
//NOTE:Pinsnotusedforinterruptsshouldbeplacedattheendofthe
//array.Callbackentriescanbeomittedfromcallbacksarrayto
//reducememoryusage.
//
GPIO_PinConfiggpioPinConfigs[]={
//Inputpins
GPIOCC26XX_DIO_13|GPIO_CFG_IN_PU|GPIO_CFG_IN_INT_RISING,//Button0
GPIOCC26XX_DIO_14|GPIO_CFG_IN_PU|GPIO_CFG_IN_INT_RISING,//Button1

//Outputpins
GPIOCC26XX_DIO_07|GPIO_CFG_OUT_STD|GPIO_CFG_OUT_STR_HIGH|GPIO_CFG_OUT_LOW,//GreenLED
GPIOCC26XX_DIO_06|GPIO_CFG_OUT_STD|GPIO_CFG_OUT_STR_HIGH|GPIO_CFG_OUT_LOW,//RedLED
};

An array of GPIO_CallbackFxn elements that is used to store callback function pointers for GPIO pins configured with interrupts. The indexes for these array elements correspond to the pins defined in the GPIO_PinConfig array. These function pointers can be defined statically by referencing the callback function name in the array element, or dynamically, by setting the array element to NULL and using GPIO_setCallback() at runtime to plug the callback entry. Pins not used for interrupts can be omitted from the callback array to reduce memory usage (if they are placed at the end of the GPIO_PinConfig array). The callback function syntax should match the following: void(*GPIO_CallbackFxn)(unsignedintindex);
 The index parameter is the same index that was passed to GPIO_setCallback(). This allows the same callback function to be used for multiple GPIO interrupts, by using the index to identify the GPIO that caused the interrupt. Below is an CC26XX device specific example of the GPIO_CallbackFxn array: //
//Arrayofcallbackfunctionpointers
//NOTE:Theorderofthepinconfigurationsmustcoincidewithwhatwas
//definedinCC2650_LAUNCH.h
//NOTE:Pinsnotusedforinterruptscanbeomittedfromcallbacksarrayto
//reducememoryusage(ifplacedatendofgpioPinConfigsarray).
//
GPIO_CallbackFxngpioCallbackFunctions[]={
NULL,//Button0
NULL,//Button1
};

The device specific GPIOCC26XX_Config structure that tells the GPIO driver where the two aforementioned arrays are and the number of elements in each. The interrupt priority of all pins configured to generate interrupts is also specified here. Values for the interrupt priority are device-specific. You should be well-acquainted with the interrupt controller used in your device before setting this parameter to a non-default value. The sentinel value of (~0) (the default value) is used to indicate that the lowest possible priority should be used. Below is an example of an initialized GPIOCC26XX_Config structure: constGPIOCC26XX_ConfigGPIOCC26XX_config={
.pinConfigs=(GPIO_PinConfig*)gpioPinConfigs,
.callbacks=(GPIO_CallbackFxn*)gpioCallbackFunctions,
.numberOfPinConfigs=sizeof(gpioPinConfigs)/sizeof(GPIO_PinConfig),
.numberOfCallbacks=sizeof(gpioCallbackFunctions)/sizeof(GPIO_CallbackFxn),
.intPriority=(~0)
};
